import React from "react";

export default function Item({todoItems}) {
  return (
    <>
      <div className="col-12 d-flex gap-2 justify-content-center mt-5">
        {
            todoItems.map((curElem)=>{
                return(
                    <>
                    <div className="col-4 col-lg-4">{curElem.name}</div>
                    <div className="col-4 col-lg-3">{curElem.dueDate}</div>

                    </>
                )
            })
        }
        <button className="col-2  col-lg-1 btn btn-outline-danger">
          delete
        </button>
      </div>
    </>
  );
}
